import { useParams } from "react-router-dom";
import useFetch from "./useFetch";

const ParkDetails = () => {
    const { parkCode } = useParams();
    console.log(parkCode);
    const { data: newPark, error, isPending } = useFetch(`https://developer.nps.gov/api/v1/parks?parkCode=${parkCode}&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE`);
    return (
        <div className="park-details">
            <h2>Park Details { parkCode } </h2>
        </div>
    );
}

export default ParkDetails;
